import React, { Component } from 'react'
import Checklist from '../../components/checklist'

class VolcanicEruptionChecklist extends Component {
  render() {
    return (
      <div>
        <Checklist title="My Checklist" list_id="volcanicEruption" />
      </div>
    )
  }
}

export default VolcanicEruptionChecklist
